import React from 'react';
import './styles/global.css';
import './styles/pages/landing.css'
import logoImg from './images/endu.png';


function App() {
  return (
    <div id="page-landing">
      <div className="content-wrapper">
        <img src={logoImg} alt="Endurance" />

      </div>
    </div>
  );
}

export default App;
